webpack
1.webpack三个核心概念
  1.module：模块，js文件 / css文件 / 图片；  2.chunk：代码块，相互依赖的模块会合并成一个代码块，模块的合集；  3.asset：资源，每个代码块会对应一个asset，每个asset会生成一个file文件输出到文件系统；
2.webpack内部使用概念
1.Compiler：代表整个webpack对象；2.Compilation：编译对象，每次新到编译生成新的compilation对象，里面会包含 modules chunks assets files...
3.webpack 流程
1.参数合并，添加默认插件   1.1 从配置文件 和 shell语句中读取参数并合并参数，得出最终的参数；2.编译阶段   2.1 开始编译：初始化Complier对象，加载所有配置的插件，执行对象的run方法开始执行编译，确定入口 entry对应的文件；   2.2 编译模块：从入口文件出发，调用所有配置的loader对模块进行编译，再递归本步骤直到所有日寇依赖的文件都经过了本步骤的处理；   2.3 完成模块编译：再经过第4步使用loader翻译完所有模块后，得到了每个模块被翻译后的最终内容以及它们之间的依赖关系；3.输出阶段   3.1 输出资源：根据入口和模块之间的依赖关系，组装成一个个包含多个模块的 Chunk，再把每个Chunk转换成一个单独的文件加入到输出列表，这步是可以修改的输出内容的最后机会；   3.2 输出完成：再确定好输出内容后，根据配置确定输出的路径和文件名，把文件内容写入到文件系统；总结  在以上过程中，webpack会在特定的时间点广播出特定的时间，插件在监听到感兴趣的事件后会执行特定的逻辑，并且插件可以调用webpack提供的API改变webpack的运行结果；  
4.webpack 调试流程 - 配合 vscode
 1.vscode debug功能：node.js  create a launch json file   作用：1.调试webpack源码；2.写webpack插件的时候用于插件的调试；
