webpack插件机制
1.webpack的插件机制  1.创建：webpack在其内部对象上创建钩子函数；  2.注册：插件将自己的方法注册到对应钩子上，交给webpack；  3.调用：webpack在编译过程中，会适时的触发相应钩子，从而触发插件的方法；2.webpack本质是一种事件流的机制，他的工作流程就是将各个插件串联起来，而实现这一切的核心就是Tapable，webpack中最核心的负责编译的Compiler和负责创建bundle的Compilation都是Tapable的实例；3.通过事件，注册和监听，触发webpack生命周期中的函数方法；
const {
  SyncHook,               // 同步
  SyncBailHook,           // 熔断，遇到第一个结果 result!==undefiend 则返回，不再继续执行
  SyncWaterfallHook,      // 瀑布，上一个执行的返回作为下一个执行的参数
  SyncLoopHook,           // 循环
