  16.6文件指纹    ·hash：每次webpack构建生成一个唯一的hash值，全局唯一，各文件共用这个hash值      ·缺点：当修改一个文件的时候，重新进行webpack打包，【所有文件】的hash值都会改变    ·chunkhash：根据chunk生成的hash值，来源于同一个chunk的hash值一样      ·优点：当修改一个文件的时候，重新进行webpack打包，只有【同一个代码块】chunk的文件的hash值会改变，其他文件保持不变    ·contenthash：根据内容生成的hash值      .优点：修改文件重新webpack打包，只有修改文件的hash改变，其他文件保持不变  
