  //解读2 稳定性：contenthash > chunkhash > hash
  module.exports={
    output:{
      filename:'[name]_[hahs].js',
      chunkFilename:'[name]_[chunkhash].js',
    },
    plugins:[
      new MiniCSSExtractPlugin({
        filename:'[name]_[contenthash].css'
      })
    ]
  }

17.Tree Shaking  17.1概述：一个模块有多个方法，只要其中某个方法使用到了，则整个文件就会被打包到bundle里面去，Tree Shaking就是只把用到到方法打包到bundle里面，没有用到的方法会在uglify阶段查处掉  17.2原理：es6模块的 import 关键字  
  //Tree Shaking 最佳实践 生产模式下
