    devtool:false,
    module:{
      rules:[
        {
          test:/\.js$/,
          // 配置{moduls:false}，不让bable转换模块，因为只有es6模块才能实现Tree Shaking 
          use:[
            {
              loader:'babel-loader',
              options:{
                presets:[
                  ['@babel/preset-env',{'modules':false}],
                  '@babel/preset-react'
                ]
