  17.3哪些代码会被优化掉    ·没有导入或使用    ·代码不可达，不会被执行    ·代码的结果没有人用    ·代码里只写不读的变量  
18.代码分割  18.1目标：1.抽离相同代买到一个共享块；2.脚本懒加载，是初始下载代码更小；  如下三个方法实现  18.2Entry Point：配置入口文件设置    ·优点：简单
    ·缺点：如果入口文件之间包含相同模块，这些相同模块会被引入各个bundle中          不够灵活，不能将核心应用程序逻辑进行动态查分代码  
  entry:{
    index:'./src/index.js',
    login:'./src/login.js'
  }

  18.3动态导入和懒加载    18.3.1概述：用到什么功能加载这个功能对应到代码，即按需加载，再给单页应用做按需加载的优化时，采用以下原则：
      ·对网站功能进行划分，每个分类一个chunk      ·首页功能直接加载，其他二级页面按需加载      ·被分割出来的代码需要一个按需加载得时机  
  // video.js
  module.exports='this is video'

  // index.js
  document.getElementById('video').addEventListener('click',event=>{
    import('./video.js').then(res=>{
      console.log(res)
    })
  })

  18.4prefetch 和 preload    18.4.1预先拉去prefetch: 浏览器会在空闲时间下载该模块，且下载时发生在父级chunk加载完成之后  
  // index.js
  import(/*webpackPrefetfch:true*/ './video.js').then(res=>{
    console.log(res)
  })
  // 原理：webpack会生成一个link标签，并将他被添加至页面头部，浏览器进入空间时间就开始加载这个文件 

18.4.2预先加载preload：会将资源的下载顺序权重提高，关键数据资源提前下载，不当使用webpackProload也会损害性能  
  ·异步chunk和父级chunk并行加载，父级chunk加载好了页面就会展示，同时等待异步chunk加载  
  // index.js
  import(/*webpackPreload:true*/ './video.js').then(res=>{
    console.log(res)
  })
  // 原理：webpack会生成一个link标签，并将他被添加至页面头部，浏览器进入空间时间就开始加载这个文件 

19.开启Scope Hoisting  19.1原理：将所有的模块按照引用顺序放在一个函数作用域里      作用：体积更小，运行更快      这个功能在production模式默认开启      webpack3新推出的功能   
