console.log(hello)

20.利用缓存  20.1webpack利用缓存有以下几个思路：    ·babel-loader开启缓存    ·使用cache-loader    ·使用hard-source-webpack-plugin  20.2babel-loader    babel在转译js过程中耗能较高，将babel执行的结果缓存起来，当重新打包构建时尝试读取缓存，从而提高打包构建速度，降低消耗  
  {
    test:/\.js$/,
    exclude:/node_modules/,
    use:[
      {
        loader:'babel-loader',
        options:{
          cacheDirectory:true
        }
      }
    ]
  }

  20.3cache-loader
    ·在一些性能开销加大对的leader之前添加此laoder，将结果缓存到洗盘里  20.4hard-source-webpack-plugin
    ·为模块提供了中间缓存，缓存默认存放路径 node_modelus/.cache/hard-source    ·配置之后，首次构建时间不会大的变化，从第二次开始，构建时间可以减少80%左右    ·webpack5中已经内置该插件  
const HardSourceWebpackPlugin = require('hard-source-webpack-plugin')
module.exports={
  plugins:[
    new HardSourceWebpackPlugin()
  ]
}

21.babel  21.1概述：是一个转换工具，把es6转换成es5代码  21.2只能转换js代码，不能转换api，如Iterator，Generator，Set，Map，Proxy，Reflect，Symble，Promise等全局对象，以及在全局对象上的方法Object.assign等。  21.3官方给出 bable-polyfill 和 babel-runtime 两种解决方案来解决这种全局对象或全局对象方法不足的问题；  21.4bable-polyfill适合在业务项目使用，babel-runtime适合在组件和类库项目中使用  21.5bable-polyfill    ·优点：使用简单（三种方式引用）    ·缺点：体积大（300k+），污染全局变量或者对象中的方法  21.6babel-runtime：babel提供单独的包babel-runtime用以提供编译模块的工具函数    ·优点：按需引用，import Promise from 'babel-runtime/core-js/promise'    ·缺点：手动import引入，coding的时候需要时时注意  21.7babel-plugin-transform-runtime    ·优点：帮助我们避免手动引入import，并且还做公用方法的抽离22.公共资源提取
  22.1webpack会基于以下条件自动分割代码块：    ·新的代码块被共享或者来自node_modules文件夹    ·新的代码块大于30kb（在min+giz之前）    ·按需加载代码块的请求数量应该    ·页面初始化是加载代码块的请求数量应该
module.exports={
